can adaptive testing and computer simulation research methods contribute to the improvement of intelligence testing and journalism during public emergencies?',
'Adaptive testing allows for intelligence testing to be tailored to the individual's ability level, while computer simulation research methods can improve journalists’ ability to respond to public emergencies based on statistical results and game models.'
