does the use of machine-learning voice analysis demonstrate the impact of STN-DBS on speech in patients with Parkinson's disease?',
'The use of machine-learning voice analysis objectively demonstrates that STN-DBS deteriorates speech in patients with Parkinson's disease, as evidenced by the higher UPDRS-III-v scores in those with STN-DBS compared to those receiving the best medical treatment.'
